-- ----------------------------
-- Table structure for pk_activity
-- ----------------------------
DROP TABLE IF EXISTS `pk_activity`;
CREATE TABLE `pk_activity`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_guid` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '关联用户guid',
  `activity_sn` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '活动唯一sn',
  `venue_sn` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '场馆sn',
  `cover_imgs` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '封面图',
  `title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '活动标题',
  `activity_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '活动地址',
  `activity_date` date NOT NULL COMMENT '活动日期',
  `activity_starttime` datetime NOT NULL COMMENT '活动开始时间',
  `activity_endtime` datetime NOT NULL COMMENT '活动结束时间',
  `cancel_apply_deadline_type` tinyint(1) NOT NULL COMMENT '取消截止时间类型 10：活动前两小时 ',
  `cancel_apply_deadline_time` datetime NOT NULL COMMENT '取消截止时间',
  `description` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '活动描述',
  `tags` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '活动标签',
  `male_min_level` tinyint(1) NOT NULL COMMENT '男参与最低级别 0：不限',
  `male_max_level` tinyint(1) NOT NULL COMMENT '男参与最高级别 0：不限',
  `female_min_level` tinyint(1) NOT NULL COMMENT '女参与最低级别 0：不限',
  `female_max_level` tinyint(1) NOT NULL COMMENT '女参与最高级别 0：不限',
  `organizer_type` tinyint(1) NULL DEFAULT 10 COMMENT '组织者类型 10：个人 20：俱乐部',
  `contact_name` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '联系人姓名',
  `contact_mobile` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '联系人手机号',
  `contact_wxid` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '联系人微信号',
  `is_team_part` tinyint(1) NOT NULL COMMENT '是否分队 10：否 20：是',
  `total_num` int(10) NULL DEFAULT NULL COMMENT '队伍总人数',
  `current_num` int(10) NULL DEFAULT NULL COMMENT '已报名总人数',
  `red_team_num` int(10) NULL DEFAULT NULL COMMENT '红队总人数',
  `red_team_current_num` int(10) NULL DEFAULT NULL COMMENT '红队已报名人数',
  `blue_team_num` int(10) NULL DEFAULT NULL COMMENT '蓝队总人数',
  `blue_team_current_num` int(10) NULL DEFAULT NULL COMMENT '蓝队已报名人数',
  `venue_cost` decimal(10, 2) NULL DEFAULT NULL COMMENT '场馆费用',
  `venue_actual_cost` decimal(10, 2) NULL DEFAULT NULL COMMENT '场馆实际费用, 队长折扣后价格',
  `entry_fee` decimal(10, 2) NULL DEFAULT NULL COMMENT '报名费',
  `longitude` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '场馆定位经度',
  `latitude` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '场馆定位纬度',
  `mark` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '有效标识(1正常 0删除)',
  `create_time` int(10) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` int(10) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `ak_activity_sn`(`activity_sn`) USING BTREE,
  INDEX `ak_user_guid`(`user_guid`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '活动表' ROW_FORMAT = Dynamic;

