DROP TABLE IF EXISTS `pk_activity_apply`;
CREATE TABLE `pk_activity_apply`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '唯一性标识',
  `apply_sn` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '报名唯一sn',
  `user_guid` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户guid',
  `activity_sn` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '活动唯一sn',
  `name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '姓名',
  `mobile` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '手机号',
  `gender` tinyint(1) NOT NULL DEFAULT 0 COMMENT '性别 1：男 2：女',
  `player_level` tinyint(1) NOT NULL DEFAULT 10 COMMENT '玩家等级',
  `is_hang` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否存在挂票 0：不存在 1：存在',
  `people_num` smallint(6) NOT NULL DEFAULT 1 COMMENT '报名人数',
  `unit_price` decimal(10, 2) NOT NULL COMMENT '报名单价',
  `total_price` decimal(10, 2) NOT NULL COMMENT '报名总价',
  `deduction_price` decimal(10, 2) NOT NULL COMMENT '抵扣价格',
  `actual_price` decimal(10, 2) NOT NULL COMMENT '实际价格',
  `consumption_integral` int(10) NOT NULL DEFAULT 0 COMMENT '消耗积分',
  `pay_status` tinyint(1) NOT NULL DEFAULT 10 COMMENT '支付状态 10：未支付 20：已支付 30：已取消',
  `mark` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '有效标识(1正常 0删除)',
  `create_time` int(10) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` int(10) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `ak_activity_sn`(`activity_sn`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '活动报名表' ROW_FORMAT = DYNAMIC;

