-- ----------------------------
-- Table structure for pk_wx_userinfo
-- ----------------------------
DROP TABLE IF EXISTS `pk_wx_userinfo`;
CREATE TABLE `pk_wx_userinfo`  (
  `user_guid` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '关联用户user_guid',
  `mobile` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '手机号',
  `name` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '姓名',
  `age` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '年龄',
  `profession` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '职业',
  `height` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '身高cm',
  `weight` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '体重kg',
  `income` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '收入',
  `marital_status` tinyint(1) NOT NULL COMMENT '婚姻状态 0：未知 10：未婚 20：已婚',
  `state_love` tinyint(1) NOT NULL COMMENT '恋爱状态 0：未知 10：恋爱中 20：未恋爱',
  `hobby` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '爱好',
  `ideal_partner` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '理想型另一半',
  `player_level` tinyint(1) NOT NULL DEFAULT 10 COMMENT '玩家等级',
  `org_level` tinyint(1) NOT NULL DEFAULT 10 COMMENT '组织者等级',
  `member_level` tinyint(1) NOT NULL DEFAULT 10 COMMENT '会员等级',
  `mvp_num` smallint(6) NOT NULL DEFAULT 0 COMMENT 'mvp次数',
  `fans_num` smallint(6) NOT NULL DEFAULT 0 COMMENT '粉丝数',
  `integral` int(10) NOT NULL DEFAULT 0 COMMENT '积分',
  `experience` int(10) NOT NULL DEFAULT 0 COMMENT '经验值',
  `tags` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '用户标签',
  `privacy_status` tinyint(1) NOT NULL DEFAULT 10 COMMENT '隐私状态 10：公开 20：仅自己可见 30：仅玩过的人可见',
  `user_sign` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '个性签名',
  `is_certification` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否实名认证 0：未实名认证 1：已实名认证',
  `idcard` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '身份证号码',
  `imgs` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '主页图片',
  `create_time` int(10) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` int(10) NULL DEFAULT NULL COMMENT '更新时间',
  UNIQUE INDEX `user_guid`(`user_guid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户信息表' ROW_FORMAT = Dynamic;

